import React from 'react'
import Neoncursor from '../Components/Neoncursor';
import Navbar from '../Components/Navbar.js';
import Footer from '../Components/Footer.js';

const Home = () => {

  const pStyle = {
    // textAlign: 'center',
    // margin: 'calc(50vh - 80px) auto 0',
    pointerEvents: 'none',
    position: 'absolute',
    width: '621px',
    height: '485px',
    left: '444px',
    top: '140px',
    fontFamily: 'Poppins',
    fontStyle: 'normal',
    fontWeight: '350',
    fontSize: '96px',
    lineHeight: '110%',
    // textAlign: 'left',
    display: 'flex',
    alignItems: 'start',
    color: '#FF4700',
  }

  return (
    <>
    <Navbar />
    <Neoncursor />
    <p style={pStyle}>light defines
    spatial experience
    as it falls and reflects</p>
    <Footer />
    </>
  )
}

export default Home;
